import React, { Component } from 'react';

class Sidebar extends Component {
  render(props){
    return (
      <nav className="sidenav">
        <div className="app_name">
          <svg className="logo">

          </svg>
        </div>
        <ul className="main-buttons">
          {this.props.items.map(item=>{
            return (
              <li>
                <i className={item.icon}></i>
                {item.main}
                {this.item.subs}
              </li>
            );
          })}
          <li>
            <i className="fa fa-circle fa-2x"></i>
            Documentations
            <ul className="hidden">
              <li>Requirements</li>
              <li>Test Plans</li>
              <li>Tracebility Matrix</li>
            </ul>
          </li>
          <li>
            <i className="fa fa-circle fa-2x"></i>
            Test Management
            <ul className="hidden">
              <li>Project overviews</li>
              <li>Test sets</li>
              <li>Templates</li>
              <li>Executions</li>
            </ul>
          </li>
          <li>
            <i className="fa fa-circle fa-2x"></i>
              Users Management
              <ul className="hidden">
                <li>Ipsum</li>
                <li>Dolor</li>
              </ul>
          </li>
        </ul>
      </nav>
    
  )};
}

export default Sidebar;
